INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-resnet50', 'ResNet在2015年被提出，在ImageNet比赛classification任务上获得第一名，因为它“简单与实用”并存，之后很多方法都建立在ResNet50或者ResNet101的基础上完成的，检测，分割，识别等领域都纷纷使用ResNet，Alpha zero也使用了ResNet，所以可见ResNet确实很好用。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/resnet50v1.5/', 'python of_cnn_train_val.py', '{"model": "resnet50", "num_nodes": "1", "num_epochs": "16", "image_counts": 100, "model_update": "momentum", "val_data_dir": "/dataset", "learning_rate": "0.256", "gpu_num_per_node": "1", "val_data_part_num": "8", "train_data_part_num": "8", "batch_size_per_device": "8", "loss_print_every_n_iter": "200", "val_batch_size_per_device": "125"}', '图像分类', '', NULL, 'harbor.dubhe.ai/train/oneflow:cudnn7-py36-of012', 1, 1, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-bert', 'BERT的全称是Bidirectional Encoder Representation from Transformers，即双向Transformer的Encoder，因为decoder是不能获要预测的信息的。模型的主要创新点都在pre-train方法上，即用了Masked LM和Next Sentence Prediction两种方法分别捕捉词语和句子级别的representation。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/bert/', 'python run_pretraining.py', '{"log_dir": "./log", "data_dir": "$DATA_DIR", "iter_num": "1000000", "seq_length": "128", "vocab_size": "30522", "data_part_num": "1", "learning_rate": "1e-4", "model_save_dir": "./snapshots", "type_vocab_size": "2", "gpu_num_per_node": "1", "num_hidden_layers": "12", "save_last_snapshot": "True", "hidden_dropout_prob": "0.1", "num_attention_heads": "12", "hidden_size_per_head": "64", "batch_size_per_device": "64", "loss_print_every_n_iter": "20", "max_position_embeddings": "512", "max_predictions_per_seq": "20", "model_save_every_n_iter": "10000", "attention_probs_dropout_prob": "0.1"}', ' NLP', '', NULL, NULL, 1, 0, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-alexnet', '2012年Imagenet图像识别大赛中，Alext提出的AlexNet网络模型一鸣惊人，引爆了神经网络的应用热潮，并且赢得了2012届图像识别大赛的冠军，这也使得卷积神经网络真正意义上成为图像处理上的核心算法。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/alexnet/', 'python of_cnn_train_val.py', '{"mom": "0.9", "model": "\\"alexnet\\"", "use_fp16": "false", "num_epoch": "90", "num_nodes": "1", "model_update": "\\"momentum\\"", "learning_rate": "0.01", "gpu_num_per_node": "1", "val_data_part_num": "256", "train_data_part_num": "256", "batch_size_per_device": "512", "loss_print_every_n_iter": "100", "val_batch_size_per_device": "512"}', '图像分类', '', NULL, NULL, 1, 0, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-mobilenetv2', 'MobileNetV2是由Google团队在MobileNet基础上提出的轻量级的CNN模型，基于导致残差结构(inverted residual structure)，该模型特别适用于移动设备设计，致力于提高移动模型在多个任务和基准以及扩不同模型大小的范围内的最新性能，它在推理过程不实现大的张量，减少了嵌入式设计对主存储器访问的需求，同时该模型也允许将输入/输出域与转换的表达方式分离。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/mobilenetv2/', 'python of_cnn_train_val.py', '{"wd": "0.00004", "mom": "0.9", "model": "\\"mobilenet_v2\\"", "lr_decay": "\'cosine\'", "num_epoch": "150", "num_nodes": "1", "model_update": "\\"momentum\\"", "learning_rate": "0.05", "use_boxing_v2": "true", "warmup_epochs": "0", "gpu_num_per_node": "1", "val_data_part_num": "256", "use_new_dataloader": "true", "train_data_part_num": "256", "batch_size_per_device": "64", "loss_print_every_n_iter": "200", "val_batch_size_per_device": "125"}', '图像分类', '', NULL, NULL, 1, 0, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-dcgan', 'DCGAN的全称是Deep Convolution Generative Adversarial Networks(深度卷积生成对抗网络)。GAN是一种生成式对抗网络，即通过对抗的方式，去学习数据分布的生成式模型。所谓的对抗，指的是生成网络和判别网络的互相对抗。生成网络尽可能生成逼真样本，判别网络则尽可能去判别该样本是真实样本，还是生成的假样本。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/degan/', 'python dcgan.py', NULL, '生成对抗网络', '', NULL, NULL, 1, 0, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-vgg16', 'VGG是牛津大学计算机视觉组（VisualGeometry Group）和GoogleDeepMind公司的研究员一起研发的的深度卷积神经网络。探索了卷积神经网络的深度与其性能间关系，通过反复堆叠3*3的小型卷积核和2*2的最大池化层，VGG成功地构筑了16~19层深的卷积神经网络。VGG相比之前state-of-the-art的网络结构，错误率大幅下降。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/vgg16/', 'python of_cnn_train_val.py', '{"model": "vgg", "num_epoch": "10", "num_nodes": "1", "image_counts": 29780, "model_update": "momentum", "learning_rate": "0.128", "gpu_num_per_node": "1", "num_val_examples": "50", "val_data_part_num": "8", "train_data_part_num": "8", "batch_size_per_device": "8", "loss_print_every_n_iter": "1", "val_batch_size_per_device": "8"}', '图像分类', '', NULL, '/train/oneflow:cudnn7-py36-of012', 1, 1, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-insightface', 'insightface使用的是18年出的arcface，Python2环境，基于mxnet实现。该算法提出了一个新的损失函数(ArcFace)，有更好的几何解释性。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/oneflow_insightface/', 'python insightface_train_val.py', '{"base_lr": 0.1, "network": "resnet100", "class_num": 85742, "loss_type": "margin_softmax", "models_name": "fc7", "total_batch_num": 5, "gpu_num_per_node": 1, "train_batch_size": 1, "train_data_part_num": 1, "part_name_suffix_length": 1, "num_of_batches_in_snapshot": 1}', '人脸识别', '', NULL, 'harbor.dubhe.ai/train/oneflow:cudnn7-py36-of012', 1, 1, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-yolov3', 'Yolov3是基于darkne的目标检测开源项目，主要应用于目标检测，该算法使用了ResNet结构以及实现了多核处理器和GPU并行运算的功能，因此可以更好的实时获取物体特征，尤其是针对小目标，精度有显著提升。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/oneflow_yolov3-0723v3/', 'python oneflow_yolov3/model/yolo_train.py', '{"base_lr": 0.01, "classes": 80, "num_boxes": 90, "num_epoch": 100, "batch_size": 4, "model_load_dir": "of_model/yolov3_model_python/", "save_frequency": 20, "gpu_num_per_node": 1}', '目标检测', '', NULL, 'harbor.dubhe.ai/train/oneflow:cudnn7-py37-of012-yolo', 1, 0, 0);
INSERT INTO `pt_train_algorithm` (`algorithm_name`, `description`, `algorithm_source`, `code_dir`, `run_command`, `run_params`, `algorithm_usage`, `accuracy`, `p4_inference_speed`, `image_name`, `is_train_out`, `is_train_log`, `is_visualized_log`) VALUES ('OneFlow预置算法-deep_and_wide', 'Wide & Deep 模型的核心思想是结合线性模型的记忆能力和 DNN 模型的泛化能力，从而提升整体模型性能。Wide & Deep 已成功应用到了 Google Play 的app推荐业务，并于TensorFlow中封装。该结构被提出后即引起热捧，在业界影响力非常大，很多公司纷纷仿照该结构并成功应用于自身的推荐等相关业务。相关算法文件请前往http://codelab.org.cn/ OneFlow项目下载相关算法最新实现。', 2, '/algorithm-manage/common/deep_and_wide/', 'python wdl_train_eval.py', '{"max_iter": "300000", "batch_size": "512", "eval_interval": "1000", "deep_vocab_size": "1603616", "wide_vocab_size": "1603616", "loss_print_every_n_iter": "1000", "train_part_name_suffix_length": "5"}', '推荐系统', '', NULL, NULL, 1, 0, 0);
